import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';

//components

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>
            <div className='main'>
                <div className='container-fluid cabecera'>
                    <div className='logo'>
                        Hola
                        </div>
                    <div className='opciones'>text-align: center;</div>
                </div>
                <div>Body</div>
            </div>
            <style global jsx>{`
                *{
                    box-sizing: border-box;
                }

                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                }

                .main{
                    width: 100%;
                    height: 100%;
                    background: linear-gradient(180deg, #C2C0C0, white);
                }

                .cabecera{
                    width: 100%;
                    border: solid 1px;
                }     


                .cabecera.logo{
                    width: 10%;

                }

                .cabecera .opciones{
                    width: 90%;  
                }
            `}</style>
        </Layout>
    );
}

export default dashboard;
